import React from 'react';

function Header(props) {
    return (
      <div className="App-header">
       <div>
        <h1>Neighborhood Map</h1>
        <h3> This map shows Elementary Schools in Englewood, CO</h3>
        </div>
      </div>
    );
}

export default Header;
